--
-- TOC entry 293 (class 1255 OID 118117)
-- Name: tr_user_check(); Type: FUNCTION; Schema: framework; Owner: postgres
--

CREATE FUNCTION tr_user_check() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
DECLARE 
	useroles json;
    
BEGIN

	IF NEW.roles is not null and  NEW.roles::varchar not like '[%]' THEN
    	perform raiserror('roles format error');
    END IF;
	IF NEW.orgs is not null and  NEW.orgs::varchar not like '[%]' THEN
    	perform raiserror('orgs format error');
    END IF;
	/*IF NEW.roles is not null and (SELECT count(*) FROM json_array_elements_text(NEW.roles)) = 0 THEN
    	perform raiserror('no roles');
    END IF;*/
    
    IF (SELECT count(*)
    	FROM json_array_elements_text(NEW.orgs) as o
        	JOIN framework.orgs as fo on fo.id = o.value::varchar::int
        WHERE fo.completed = false)>0
    THEN
    	PERFORM raiserror('org is not found"');
    END IF;
    
    SELECT
    	 roles
    FROM framework.users
    WHERE id = NEW.userid
    INTO useroles;
    
    IF NEW.roles::VARCHAR<>OLD.roles::varchar THEN
    	
     IF (SELECT 
      	coalesce( min(r.hierarchy),100000)
      FROM  json_array_elements_text(Old.roles) as o
      	JOIN framework.roles as r on r.id = o.value::varchar::smallint) <
      (SELECT 
      		coalesce( min(r.hierarchy),100000)
      FROM  json_array_elements_text(useroles) as o
      	JOIN framework.roles as r on r.id = o.value::varchar::smallint) THEN
       perform raiserror('roles hierarchy error');
       
     END IF;   
          
    END IF;
    
    IF ((NEW.isactive and TG_OP = 'INSERT') OR (NEW.isactive and NEW.isactive<>OLD.isactive)) and ((SELECT count(*) FROM json_array_elements_text(NEW.roles)) = 0
    	OR (SELECT count(*) FROM json_array_elements_text(NEW.orgs)) = 0
        OR coalesce(NEW.fam,'') = ''
        OR coalesce(NEW.im,'') = ''
        OR coalesce(NEW.password,'') = ''
        OR coalesce(NEW.login,'') = '') THEN
        perform raiserror('Please check all data');
    END IF;
	IF NEW.password is not null and NEW.password = '' THEN
    	perform raiserror('password can not be empty');
    END IF;
    IF NEW.photo is not null THEN
      IF (SELECT count(*) FROM json_array_elements_text(new.photo)) > 1 THEN
      	PERFORM raiserror('More then 1 file');
      END IF;    
    END IF;
    IF not(upper((new.photo->0)::json->>'filename') like '%.JPG'
       OR upper((new.photo->0)::json->>'filename') like '%.JPEG'
       OR upper((new.photo->0)::json->>'filename') like '%.GIF' 	 
       OR upper((new.photo->0)::json->>'filename') like '%.PNG') THEN
    	PERFORM raiserror('choose file with format jpg, png, gif');
    END IF;
    return NEW;    

END;
$$;


ALTER FUNCTION framework.tr_user_check() OWNER TO postgres;

--
-- TOC entry 294 (class 1255 OID 118118)
-- Name: tr_view_tr_check(); Type: FUNCTION; Schema: framework; Owner: postgres
--

CREATE FUNCTION tr_view_tr_check() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
BEGIN
	IF NEW.viewtype like '%api' and NEW.tablename is NULL THEN
    -- if data-binding from API method - view type is api, tablename is not neccesary
    	NEW.tablename = '';
    END IF;
    
    /*CONFIG CHECKER*/
        /*check title uniq*/
        IF
          (SELECT
              count(*)
           FROM (
            SELECT
              count(*) as k,
              p.title
            FROM
              (SELECT
                  value->>'title' as title
              FROM json_array_elements(NEW.config)) as p
              GROUP BY title
              HAVING count(*) > 1) as pz) > 0 
        THEN
            PERFORM raiserror('"title" in config must be uniq');
        END IF;
        
        --check key
        IF
			(SELECT count(key)
             FROM
              (SELECT
                  value->>'key' as key
              FROM json_array_elements(NEW.config)) as p
              WHERE p.key is null) > 0 
        THEN
            PERFORM raiserror('"key" in one of column in config is null');
        END IF;
        
        
        -- check key uniq
        IF
          (SELECT
              count(*)
           FROM (
            SELECT
              count(*) as k,
              p.key
            FROM
              (SELECT
                  value->>'key' as key
              FROM json_array_elements(NEW.config)) as p
              GROUP BY key
              HAVING count(*) > 1) as pz) > 0 
        THEN
            PERFORM raiserror('"key" in config must be uniq');
        END IF;
        
        
        /*check t in config - allias must be if not function*/
        IF 
            (SELECT
                  count(*)
             FROM json_array_elements(NEW.config)
             WHERE (value->>'fn') is null and
                   (value->>'t') is null 
             ) > 0 
        THEN
            PERFORM raiserror('Can''t find "t" for some columns in config');
        END IF;    

    	
        /*check not null params*/
        IF 
          (SELECT
              count(*)
          FROM json_array_elements(NEW.config)
          WHERE
              coalesce((value->>'col'),'') = '' or
              coalesce((value->>'title'),'') = '' or
              (value->>'visible') is null or 
              (value->>'type') is null
          ) > 0
        THEN
            PERFORM raiserror('"col", "title", "type", or "visible" can''t be empty');	
        END IF;
        
        
    /*CONFIG CHECKER*/
    
    
    /*ACTS CHECKER*/
        /*check not null values*/
        IF
         (SELECT
          	count(*)
          FROM json_array_elements(NEW.acts)
          WHERE 
            COALESCE((value->>'title'),'') = '' or
            COALESCE((value->>'type'),'') = '' or
            (value->>'isforevery') is null 
          ) > 0
        THEN
        	PERFORM raiserror('In acts "title", "type", "isforevery" can''t be empty');
    	END IF;
    
    	/*check act (url) for link, api*/
        IF
         (SELECT
          	count(*)
          FROM json_array_elements(NEW.acts)
          WHERE upper((value->>'type')) in ('LINK', 'API', 'LINKTO')
          		and 
            coalesce((value->>'act'),'') = '' 
          ) > 0
        THEN
        	PERFORM raiserror('In acts types (link, api) "act" can''t be empty!');
    	END IF;
        
        /*check act title*/
        IF
          (SELECT
              count(*)
           FROM (
            SELECT
              count(*) as k,
              p.title
            FROM
              (SELECT
                  value->>'title' as title
              FROM json_array_elements(NEW.acts)) as p
              GROUP BY title
              HAVING count(*) > 1) as pz) > 0 
        THEN
        	PERFORM raiserror('In acts "title" must be uniq!');
    	END IF;
        
        -- check act parametrs key
        IF
          (SELECT
              count(g.k)
          FROM
          (SELECT
              (SELECT count(p.value)
               FROM json_array_elements(a.value->'parametrs') as p
               WHERE p.value->>'paramcolumn' is not null and 
                   (p.value->'paramcolumn' )->>'key' is null) as k,
              a.value->'title'
          FROM json_array_elements(NEW.acts) as a) as g
          WHERE g.k > 0 ) > 0 
        THEN
        	PERFORM raiserror(CONCAT(
            	'there is a act parameter without "key" - ',
                 (SELECT
                     title
                  FROM
                  (SELECT
                      (SELECT count(p.value)
                       FROM json_array_elements(a.value->'parametrs') as p
                       WHERE p.value->>'paramcolumn' is not null and 
                           (p.value->'paramcolumn' )->>'key' is null) as k,
                      a.value->'title' as title
                  FROM json_array_elements(NEW.acts) as a) as g
                  WHERE g.k > 0
                  LIMIT 1
                  )
            ));
        END IF;

        
    /*ACTS CHECKER*/
    
    RETURN NEW;

END;
$$;


